import React from 'react';

const Article = (props) => {
  console.dir(props)
  const { article } = { "article": { "article_id": 29, "title": "A BRIEF HISTORY OF FOOD—NO BIG DEAL", "body": "n 1686, the croissant was invented in Austria. That's a fun fact I'd probably never had known or maybe don't even really need to know, but now I do, thanks to Julia Rothman's Food Anatomy: The Curious Parts & Pieces of Our Edible World. Rothman has an entire series of illustrated Anatomy books, including Nature and Farm, packed with infographics, quirky facts, and maps that you can get lost in for hours—in a fun way, not in a boring textbook way. It makes you wonder why textbooks aren't this fun to read. Can someone look into this? Thanks.", "votes": 0, "topic": "cooking", "author": "tickle122", "created_at": "2017-03-11T00:00:00.000Z", "comment_count": "10" } }
  return <div>
    <h3>{article.title}</h3>
    <h4>Created by {article.author}, {article.created_at}</h4>
    <p>{article.body}</p>
    <h4>{article.comment_count} Comments:</h4>
  </div>
}

export default Article;
